import React from 'react';
import './static/App.css';

function App() {
  const greeting = "greeting";
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Hello world
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <h1 id={greeting}>Hello, world</h1>
      <p>I'm writing JSX</p>
    </div>
  );
}

export default App;
